import React from 'react';

export default function Layout({ header, main, sidebarRight, footer }) {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', minHeight: '100vh', backgroundColor: '#024731' }}>
      <header style={{ padding: '1rem', color: '#ccc', backgroundColor: '#024731' }}>{header}</header>
      <div style={{ display: 'flex', flex: 1 }}>
        <main
          style={{
            flex: 2, // Main content takes two-thirds of the width
            padding: '1rem',
            backgroundColor: '#024731',
          }}
        >
          {main}
        </main>
        <aside
          style={{
            flex: 1, // Sidebar takes one-third of the width
            padding: '1rem',
            backgroundColor: '#024731',
          }}
        >
          {sidebarRight}
        </aside>
      </div>
      <footer style={{ padding: '1rem', color: '#ccc', backgroundColor: '#024731' }}>{footer}</footer>
    </div>
  );
}
